import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import CreateCRUD from '../components/CreateCRUD.vue'
import ReadCRUD from '../components/ReadCRUD.vue'
import UpdateCRUD from '../components/UpdateCRUD.vue'
import DeleteCRUD from '../components/DeleteCRUD.vue'


const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/create',
    name: 'CreateCRUD',
    component: CreateCRUD
  },
  {
    path: '/read',
    name: 'ReadCRUD',
    component: ReadCRUD
  },
  {
    path: '/update',
    name: 'UpdateCRUD',
    component: UpdateCRUD
  },
  {
    path: '/delete',
    name: 'DeleteCRUD',
    component: DeleteCRUD
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
